using Microsoft.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore.Metadata.Builders;
using WASMChat.Data.Entities.Files;

namespace WASMChat.Data.EntityConfigurations;

public class DatabaseFileEntityConfiguration : IEntityTypeConfiguration<DatabaseFile>
{
    public void Configure(EntityTypeBuilder<DatabaseFile> builder)
    {
        builder.ToTable("DatabaseFiles");

        builder.HasKey(x => x.Id);

        builder.Property(x => x.Scope)
            .HasConversion<string>();

        builder.HasAlternateKey(x => x.Name);

        var initialValues = new[]
        {
            new DatabaseFile
            {
                Id = 1,
                Scope = DatabaseFileScope.Avatar,
                MimeType = System.Net.Mime.MediaTypeNames.Image.Jpeg,
                Name = "DefaultAvatar.jpg",
                Content = Convert.FromBase64String(DefaultAvatarBase64),
            },
            new DatabaseFile
            {
                Id = 2,
                Scope = DatabaseFileScope.Avatar,
                MimeType = System.Net.Mime.MediaTypeNames.Image.Jpeg,
                Name = "DefaultChat.jpg",
                Content = Convert.FromBase64String(DefaultChatBase64),
            }
        };
        builder.HasData(initialValues);
    }

    private const string DefaultAvatarBase64 =
        "";

    private const string DefaultChatBase64 =
        "";
}